contracts/mintNode.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "./quickint.sol";


interface Zmb {
   function _mint(address _user, uint _rand) external; // (msg.sender, rand)
}

interface Car {
    function _mint(address _user, uint _rand) external; // same 
    function ownerOfId(uint _id, address _add) external view returns(bool);
    function transferNfts(address _from, address _to, uint _id) external;
}   // -- make sure that these functions can only be called by MintNode Contract!!

interface BrainOracle {
    function calcFullPrice(uint _bnbPrice) external view returns(uint);
    function getBrInOne() external view returns(uint); // this one gives you the amount of br for 1 dollar. ---- more precise.
}



contract MintNode is Ownable, ERC721 {

    constructor( string memory _name, string memory _symbol) ERC721(_name, _symbol) { // oracle is kingwallet, _brains is erc20 token

        bnbPrice = 488;        // testnet currently 488
    }

    //Addresses
    IERC20 brains;
    address public brainsAddress;

    address private oracleAddress;   // king on cloud one .

    Zmb zombieContract;         // Requires Setter
    address public zmbAddress;

    Car carContract;            // Requires Setter
    address public carAddress;

    BrainOracle priceOracle;
    address public priceOracleAddress;  // requires ssetter

    //Mappings
    mapping(address => uint) public qCounterZ;
    mapping(address => mapping(uint => uint)) public mintingQuequeZ;    // zmbCounter

    mapping(address => uint) public qCounterC;
    mapping(address => mapping(uint => uint)) public mintingQuequeC;    // carCounter

    function killCounterZ(address _add) public onlyKing { // these functions need to be called by the king oracle
        qCounterZ[_add]--;                                // after each mint.
    }

    function killCounterC(address _add) public onlyKing {
        qCounterC[_add]--;
    }

    //BrainOracle functions.
    uint public brainsPerDollar;
    uint public bnbPrice;

    function setBnb(uint _bnb) public onlyOwner {         // bnb needs to be set, otherwise wont work.
        bnbPrice = _bnb;
    }

    function getPrice() public {
        brainsPerDollar = priceOracle.getBrInOne();
    }

    event payedForZombie(address, uint);
    event payedForCar(address, uint);

    //Pay first.
    function mintFree() public { // only zombie
        qCounterZ[msg.sender] += 1;
        mintingQuequeZ[msg.sender][qCounterZ[msg.sender]] = block.timestamp;
        emit payedForZombie(msg.sender, qCounterZ[msg.sender]);
    }

    function _mintZombieWithBr() public payable {  
        getPrice();
        require(brainsPerDollar > 0, "Possible underflow/overflow issue on uniOracle.");
        uint m_price = 4 * brainsPerDollar;            // might not be the best idea to hard code these. -- save the 30 somewhere else & make it changable ;)
        uint x = divideBy18(m_price);
        require(brains.allowance(msg.sender, address(this)) >= x, "to little allowance.");
        uint u_balance = brains.balanceOf(msg.sender);
        require(u_balance >= x, "To little balance of brians.");
        require(brains.transferFrom(msg.sender, address(this), m_price), "Transfer failed");
        qCounterZ[msg.sender] += 1;
        mintingQuequeZ[msg.sender][qCounterZ[msg.sender]] = block.timestamp;
        emit payedForZombie(msg.sender, qCounterZ[msg.sender]);
    }

    function err_mint() public {
        require(qCounterZ[msg.sender] > 0, "You dont have any nfts in queue.");
        require(block.timestamp - mintingQuequeZ[msg.sender][qCounterZ[msg.sender]] > 2 hours, "You need to wait still");
        emit payedForZombie(msg.sender, qCounterZ[msg.sender]);
    }

    function divideBy18(uint _num) internal pure returns(uint) {
        return _num/1e18;
    }

    function _mintCarWithBr() public payable {
        getPrice();
        require(brainsPerDollar > 0, "Possible underflow/overflow issue on uniOracle.");
        uint m_price = 4 * brainsPerDollar;            // might not be the best idea to hard code these. -- save the 30 somewhere else & make it changable ;)
        uint x = divideBy18(m_price);
        require(brains.allowance(msg.sender, address(this)) >= x, "to little allowance.");
        uint u_balance = brains.balanceOf(msg.sender); // test balanceOf .. if 12 or 12e18
        require(u_balance >= x, "To little balance of brians.");
        require(brains.transferFrom(msg.sender, address(this), m_price), "Transfer failed");
        qCounterC[msg.sender] += 1;
        mintingQuequeC[msg.sender][qCounterC[msg.sender]] = block.timestamp;
        emit payedForCar(msg.sender, qCounterC[msg.sender]);
    }

    // level up functions - later..


    // Marketplace Code.

    struct CarS {
        uint price;
        uint id;
        address owner;
        bool status;
    }

    struct ZombiesS {
        uint price;
        uint id;
        address owner;
        bool status;
    }

    CarS[] cars;
    ZombiesS[] zombies;

    mapping(uint => address) public idOwnerC;
    mapping(address => uint) public howManyC;

    mapping(uint => bool) public nftIdSaleC;    // if this nft's id is enlisted 

    uint fee = 0.05 ether;

    uint counterSellC = 0;
    function sellCar(uint _price, uint _id) public payable {
        // the enlisting button for this function should be sealed until you
        // authorize this protocol to be able to transfer all your nfts.
        require(nftIdSaleC[_id] == false, "already on slae");   // checks if the mapping of the id is true or false, so the same id cant be posted many times.
        require(carContract.ownerOfId(_id, msg.sender), "You Are not the owner of this id."); // verifies if _id & address match
        require(msg.value >= fee, "Not enough bnb.");
        // uint ethers_price = _price * 1e18;
        CarS memory newRequestC = CarS(_price, _id, msg.sender, true);
        cars.push(newRequestC);
        pop(msg.sender, counterSellC);
        nftIdSaleC[_id] = true;
        idOwnerC[counterSellC] = msg.sender;
        howManyC[msg.sender]++;
        counterSellC++;
    }

    /// quick getter for price for testing.
    function getPriceC(uint _id) public view returns(uint) {
        return cars[_id].price;     // returns price of enlisted to sell car.
    }

    mapping(uint => address) public idOwnerZ;
    mapping(address => uint) public howManyZ;

    mapping(uint => bool) public nftIdSaleZ;    // if this nft's id is enlisted 

    uint counterSellZ = 0;
    function sellZmb(uint _price, uint _id) public payable {
        require(nftIdSaleZ[_id] == false, "already on sale.");          // checks if nft id is already on sale
        require(msg.value >= fee, "Not enought ether");
        uint ethers_price = _price * 1e18;
        ZombiesS memory newRequestZ = ZombiesS(ethers_price, _id, msg.sender, true);
        zombies.push(newRequestZ);
        pop(msg.sender, counterSellZ);
        nftIdSaleZ[_id] = true;
        idOwnerZ[counterSellZ] = msg.sender;
        howManyZ[msg.sender]++;
        counterSellZ++;
    }



    function priceGetterC(uint _id) public view returns(uint) {
        return cars[_id].price;
    }

    function settingBoolC(uint _id) internal {
        cars[_id].status = false;
    }

    function priceGetterZ(uint _id) public view returns(uint) {
        return zombies[_id].price;
    }

    function settingBoolZ(uint _id) internal {
        cars[_id].status = false;
    }


    function buyCar(uint _id) public payable {  // this id is the sell bidding array index.
        uint x = priceGetterC(_id);
        uint buyFee = 5e16;
        require(msg.value >= x + buyFee, "Not enough payed.");
        carContract.transferNfts(cars[_id].owner, msg.sender, cars[_id].id);    // wont work if they havent set allowance first. Need approve().
        cars[_id].status = false;
        nftIdSaleC[cars[_id].id] = false;
    }


    // Boring setter functions

    function setCars(address _add) public onlyOwner {
        carContract = Car(_add);
        carAddress = _add;
    }

    function setZmb(address _add) public onlyOwner {
        zombieContract = Zmb(_add);
        zmbAddress = _add;
    }

    function setBrains(address _add) public onlyOwner {
        brains = IERC20(_add);
    }

    function setOracle(address _add) public onlyOwner {
        priceOracle = BrainOracle(_add);        // priceOracle
        priceOracleAddress = _add;
    }

    function setKingOracle(address _add) public onlyOwner { // king address oracle.
        oracleAddress = _add;
    }

    modifier onlyKing() {
        require(msg.sender == oracleAddress, "You are not inside a cloud.");
        _;
    }

    //security ~logic
        function pop(address to, uint256 tokenId) internal virtual {
            _mint(to, tokenId);
            require(_checkOnERC721Received(address(0), to, tokenId), "not today");
        }

        function isContract(address account) internal view returns(bool) {
            return account.code.length > 0;
        }

        function _checkOnERC721Received(
        address from,
        address to,
        uint256 tokenId
    ) private returns (bool) {
        if (isContract(to)) {
            try IERC721Receiverr(to).onERC721Received(_msgSender(), from, tokenId) returns (bytes4 retval) {
                return retval == IERC721Receiver.onERC721Received.selector;
            } catch (bytes memory reason) {
